import { createIcon } from "../icon/createIcon";

export const LocationIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="LocationIcon">
    <path d="M6 0a4 4 0 0 1 3.396 6.114L6 12 2.666 6.212A4 4 0 0 1 6 0zm0 2a2 2 0 1 0-.001 3.999A2 2 0 0 0 6 2z" />
  </svg>,
  "Location",
  "location"
);
